syntax = "proto2";

package feedwire;

option optimize_for = LITE_RUNTIME;

message ChromeFeedResponseMetadata {
  optional bool privacy_notice_fulfilled = 1;
  optional bool logging_enabled = 2;
  optional string session_id = 3;
}
